import React from "react";
import "./scss/style.scss";

const fetchData = () => {
  fetch("https://nethergames.de:1763/check?message=%20%20test%20&render=true").then((res) => console.log(res));
};

const App = () => {
  return (
    <div className="container">
      <div className="container__text">
        <textarea className="container__input"></textarea>
      </div>
      <div onClick={fetchData} className="container__button">Button</div>
    </div>
  );
};

export default App;
